INSERT INTO `posts` (`id`, `category_id`, `image`, `name`, `content`, `created_at`, `updated_at`) VALUES
(6, 2, 'test.png', 'Test 6', '<p><strong><img src=\"data:image/png;base64,\" /></strong></p>\r\n<p><strong>Bệnh gl&ocirc;c&ocirc;m &ndash; ai dễ mắc bệnh?</strong></p>\r\n<p>Tất cả mọi người ở mọi lứa tuổi v&agrave; ở mọi chủng tộc cũng c&oacute; thể bị gl&ocirc;c&ocirc;m. Thường thường th&igrave; những người lớn tuổi bị bệnh gl&ocirc;c&ocirc;m nhiều hơn c&aacute;c trẻ em.</p>\r\n<p class=\"panswer\">Tuy nhi&ecirc;n c&oacute; một số nh&oacute;m người sau đ&acirc;y c&oacute; nguy cơ bệnh cao hơn: người tr&ecirc;n 40 tuổi, người c&oacute; bệnh tiểu đường hay cao huyết &aacute;p, người c&oacute; tiền căn gia đ&igrave;nh đ&atilde; mắc bệnh gl&ocirc;c&ocirc;m, người bị viễn thị, gi&aacute;c mạc (tr&ograve;ng đen) nhỏ, người c&oacute; tiền sử d&ugrave;ng thuốc nh&oacute;m steroid đường to&agrave;n th&acirc;n hoặc tra mắt trong thời gian d&agrave;i, cận thị nặng, c&oacute; tiền căn chấn thương hay phẫu thuật mắt.</p>\r\n<p class=\"panswer\">&nbsp;</p>\r\n<p class=\"panswer\"><strong>Bệnh gl&ocirc;c&ocirc;m &ndash; kh&ocirc;ng thể chữa khỏi</strong></p>\r\n<p>Bệnh gl&ocirc;c&ocirc;m kh&ocirc;ng c&oacute; thể chữa hết được v&agrave; những tầm nh&igrave;n n&agrave;o đ&atilde; bị mất kh&ocirc;ng thể hồi phục lại được. Với những thuốc nhỏ cho gl&ocirc;c&ocirc;m v&agrave; những phẫu thuật tối t&acirc;n nhất cho gl&ocirc;c&ocirc;m hiện nay, c&aacute;c b&aacute;c sĩ chỉ c&oacute; thể l&agrave;m cho bệnh gl&ocirc;c&ocirc;m tiến triển chậm lại m&agrave; th&ocirc;i. Bệnh gl&ocirc;c&ocirc;m l&agrave; một bệnh kinh ni&ecirc;n. Bệnh n&agrave;y phải được theo d&otilde;i cả đời. &ETH;ể gi&uacute;p cho bệnh nh&acirc;n giữ được tầm nh&igrave;n của họ, bệnh gl&ocirc;c&ocirc;m phải được định bệnh v&agrave; chữa trị một c&aacute;ch ch&iacute;nh x&aacute;c.</p>\r\n<p>Để điều trị c&oacute; hiệu quả, điều quan trọng nhất đối với c&aacute;c bệnh nh&acirc;n gl&ocirc;c&ocirc;m hoặc nghi ngờ gl&ocirc;c&ocirc;m l&agrave; việc chẩn đo&aacute;n sớm, điều trị l&acirc;u d&agrave;i v&agrave; được b&aacute;c sĩ chuy&ecirc;n khoa mắt theo d&otilde;i chặt chẽ. Điều n&agrave;y sẽ gi&uacute;p bệnh nh&acirc;n kiểm so&aacute;t được &aacute;p lực nội nh&atilde;n v&agrave; ngăn ngừa sự tổn hại tầm nh&igrave;n. Việc cần nhất phải l&agrave;m l&agrave; d&ugrave;ng thuốc nhỏ mắt hằng ng&agrave;y theo toa của b&aacute;c sĩ chuy&ecirc;n khoa gl&ocirc;c&ocirc;m. Ngo&agrave;i ra, phẫu thuật l&agrave; rất cần thiết để cứu v&atilde;n thị lực v&agrave; tầm nh&igrave;n cho bệnh nh&acirc;n trong trường hợp điều trị bằng thuốc v&agrave; laser kh&ocirc;ng hiệu quả.</p>', '2017-09-12 04:21:42', '2017-09-13 03:15:37');

