INSERT INTO `question` (`id`, `name`, `content`, `is_active`, `created_at`, `updated_at`) VALUES
(1, 'Phẫu thuật thẩm mỹ như thế nào để an toàn?', 'Lựa chọn cơ sở y tế uy tín, bác sĩ tay nghề cao\r\n\r\nGặp Bác sĩ để được tư vấn trực tiếp, xác định những biến chứng có thể xảy ra, mức độ an toàn, yếu tố nguy cơ trong quá trình phẫu thuật.\r\n\r\nTuân thủ tuyệt đối chỉ dẫn của Bác sĩ. Chăm sóc kĩ sau phẫu thuật', 1, '2017-09-11 17:00:00', '2017-09-13 01:26:36'),
(2, 'Nâng mũi được bao lâu?', 'Với các ưu điểm, ưu việt của các phương pháp hiện đại ngày nay, bạn có thể hoàn toàn yên tâm về kết quả sau này, duy trì lâu dài, vĩnh viễn, hoàn toàn không để lại sẹo.', 1, '2017-09-11 17:00:00', '2017-09-13 01:26:51'),
(3, 'Làm sao để ngực đẹp và quyến rũ nhất?', 'Thực phẩm dinh dưỡng: Tăng cường nhóm thực phẩm giàu protein và chất béo để kích thích mô ngực phát triển.\r\n\r\nTập thể dục liên quan đến ngực: Nên chọn các bài tập dành riêng cho cơ ngực để thúc đẩy ngực phát triển tự nhiên.\r\n\r\nTrang phục áo ngực phù hợp: Áo ngực quá chật không chỉ khiến ngực không phát triển. Mặt khác còn có thế gây ra các bệnh về da như nổi mẩn đỏ thậm chí gây tắc tuyến sữa.', 1, '2017-09-11 17:00:00', '2017-09-13 01:26:55'),
(4, 'Phẫu thuật thẩm mỹ như thế nào để an toàn?', 'Lựa chọn cơ sở y tế uy tín, bác sĩ tay nghề cao\r\n\r\nGặp Bác sĩ để được tư vấn trực tiếp, xác định những biến chứng có thể xảy ra, mức độ an toàn, yếu tố nguy cơ trong quá trình phẫu thuật.\r\n\r\nTuân thủ tuyệt đối chỉ dẫn của Bác sĩ. Chăm sóc kĩ sau phẫu thuật', 1, '2017-09-11 17:00:00', '2017-09-13 01:27:00'),
(5, 'Nâng mũi được bao lâu?', 'Với các ưu điểm, ưu việt của các phương pháp hiện đại ngày nay, bạn có thể hoàn toàn yên tâm về kết quả sau này, duy trì lâu dài, vĩnh viễn, hoàn toàn không để lại sẹo.', 1, '2017-09-11 17:00:00', '2017-09-13 01:27:05'),
(6, 'Question 123', 'Answer 123', 1, '2017-09-12 10:01:25', '2017-09-13 01:27:19');

